import React from 'react';

const Contact = (props) => {

		const dataLocal = props.dataLocal

		const display = (
		    <div>
				<div className='infoCategory'>
				{dataLocal.category}
				</div>
				<div className='infoTitle'>
				{dataLocal.title}
				</div>
				<div className='email'>
				email : stellaireperso@gmail.com
				</div>
				<div className='arrow'>
				^
				|your way
				| 
				|or        this way
				--------------------->
				</div>
		    </div>
		)

		return (
				<div>
						{display}

				</div>
		)
}
export default Contact;
